import React, { Component } from 'react';
import Slider from '@material-ui/lab/Slider';
import './PersonsCount.scss'
class PersonsCount extends Component {
    state = {
        x:0,
    }
    handleChange =()=>{
        this.setState({
            x: this.state+1
        })
    }

    render() {
        return (
            <div className="sliders-container">
                <Slider/>
            </div>
        )

    }
}

export default PersonsCount;
